import { Authorization } from '@modules/auth';
import { PageHeader } from 'antd';
import PermissionType from '../components/PermissionType';

const PermissionTypePage = () => {

    return (
        <Authorization allowedAccess={["PermissionTypeView"]}>
			<PageHeader onBack={() => null} title="Permission Type" />
            <PermissionType />
		</Authorization>
    );
};

export default PermissionTypePage;
